// OnConflict allows configuring the `ON CONFLICT` / `ON DUPLICATE KEY` clause
// of the `INSERT` statement. For example:
//
//	client.TestResult.CreateBulk(builders...).
//		OnConflict(
//			// Update the row with the new values
//			// the was proposed for insertion.
//			sql.ResolveWithNewValues(),
//		).
//		// Override some of the fields with custom
//		// update values.
//		Update(func(u *ent.TestResultUpsert) {
//			SetRun(v+v).
//		}).
//		Exec(ctx)
func (trcb *TestResultCreateBulk) OnConflict(opts ...sql.ConflictOption) *TestResultUpsertBulk {
	trcb.conflict = opts
	return &TestResultUpsertBulk{
		create: trcb,
	}
}

// OnConflictColumns calls `OnConflict` and configures the columns
// as conflict target. Using this option is equivalent to using:
//
//	client.TestResult.Create().
//		OnConflict(sql.ConflictColumns(columns...)).
//		Exec(ctx)
func (trcb *TestResultCreateBulk) OnConflictColumns(columns ...string) *TestResultUpsertBulk {
	trcb.conflict = append(trcb.conflict, sql.ConflictColumns(columns...))
	return &TestResultUpsertBulk{
		create: trcb,
	}
}

// TestResultUpsertBulk is the builder for "upsert"-ing
// a bulk of TestResult nodes.
type TestResultUpsertBulk struct {
	create *TestResultCreateBulk
}

// UpdateNewValues updates the mutable fields using the new values that
// were set on create. Using this option is equivalent to using:
//
//	client.TestResult.Create().
//		OnConflict(
//			sql.ResolveWithNewValues(),
//			sql.ResolveWith(func(u *sql.UpdateSet) {
//				u.SetIgnore(testresult.FieldID)
//			}),
//		).
//		Exec(ctx)
func (u *TestResultUpsertBulk) UpdateNewValues() *TestResultUpsertBulk {
	u.create.conflict = append(u.create.conflict, sql.ResolveWithNewValues())
	u.create.conflict = append(u.create.conflict, sql.ResolveWith(func(s *sql.UpdateSet) {
		for _, b := range u.create.builders {
			if _, exists := b.mutation.ID(); exists {
				s.SetIgnore(testresult.FieldID)
			}
			if _, exists := b.mutation.Run(); exists {
				s.SetIgnore(testresult.FieldRun)
			}
			if _, exists := b.mutation.Shard(); exists {
				s.SetIgnore(testresult.FieldShard)
			}
			if _, exists := b.mutation.Attempt(); exists {
				s.SetIgnore(testresult.FieldAttempt)
			}
		}
	}))
	return u
}

// Ignore sets each column to itself in case of conflict.
// Using this option is equivalent to using:
//
//	client.TestResult.Create().
//		OnConflict(sql.ResolveWithIgnore()).
//		Exec(ctx)
func (u *TestResultUpsertBulk) Ignore() *TestResultUpsertBulk {
	u.create.conflict = append(u.create.conflict, sql.ResolveWithIgnore())
	return u
}

// DoNothing configures the conflict_action to `DO NOTHING`.
// Supported only by SQLite and PostgreSQL.
func (u *TestResultUpsertBulk) DoNothing() *TestResultUpsertBulk {
	u.create.conflict = append(u.create.conflict, sql.DoNothing())
	return u
}

// Update allows overriding fields `UPDATE` values. See the TestResultCreateBulk.OnConflict
// documentation for more info.
func (u *TestResultUpsertBulk) Update(set func(*TestResultUpsert)) *TestResultUpsertBulk {
	u.create.conflict = append(u.create.conflict, sql.ResolveWith(func(update *sql.UpdateSet) {
		set(&TestResultUpsert{UpdateSet: update})
	}))
	return u
}

