// ClearTimingBreakdown clears the value of the "timing_breakdown" field.
func (u *TestResultUpsertBulk) ClearTimingBreakdown() *TestResultUpsertBulk {
	return u.Update(func(s *TestResultUpsert) {
		s.ClearTimingBreakdown()
	})
}

// Exec executes the query.
func (u *TestResultUpsertBulk) Exec(ctx context.Context) error {
	if u.create.err != nil {
		return u.create.err
	}
	for i, b := range u.create.builders {
		if len(b.conflict) != 0 {
			return fmt.Errorf("ent: OnConflict was set for builder %d. Set it on the TestResultCreateBulk instead", i)
		}
	}
	if len(u.create.conflict) == 0 {
		return errors.New("ent: missing options for TestResultCreateBulk.OnConflict")
	}
	return u.create.Exec(ctx)
}

// ExecX is like Exec, but panics if an error occurs.
func (u *TestResultUpsertBulk) ExecX(ctx context.Context) {
	if err := u.create.Exec(ctx); err != nil {
		panic(err)
	}
}
